Actionscript.script:
import flash.events.MouseEvent;
import flash.display.MovieClip;

trace("ADVERSITY WEAPON PACK v1.0.0\nDeveloped by XWILKINX (www.xwilkinx.com)");

stop();

var frames:Array = ["intro", "items", "mods", "misc"];

b_prev.addEventListener(MouseEvent.CLICK, mouseHandler);
b_next.addEventListener(MouseEvent.CLICK, mouseHandler);

function mouseHandler(e:MouseEvent):void {
	
	var mc:MovieClip = e.currentTarget as MovieClip;
	
	if (mc == b_next) {
		
		goto(true);
		
	}
	else if (mc == b_prev) {
		
		goto(false);
		
	}
	
}

function goto(_next:Boolean):void {
	
	var index:int = frames.indexOf(currentFrameLabel);
	
	if (index >= 0) {
	
		if (_next && ((index + 1) < frames.length)) {
			
			gotoAndStop(frames[index + 1]);
			
		}
		else if (!_next && ((index - 1) >= 0)) {
			
			gotoAndStop(frames[index - 1]);
			
		} 
	
	}
	
}
